import express from "express";

let configViewEngine = (app) => {
    app.use(express.static("./src/public"));
    app.set("view engine", "ejs"); // sử dụng câu lệnh if else vòng lăp
    app.set("views", "./src/views")
}

module.exports = configViewEngine;

