sourcesContent:
import { reject } from "bcrypt/promises";
import bcrypt from "bcryptjs";
import db from "../models";

const salt = bcrypt.genSaltSync(10); //dùng để hash password

let createNewUser = async (data) => {
    return new Promise (async (resolve, reject) => {
        try{
            let hashPasswordFromBcrypt = await hashUserPassword(data.password);
            await db.User.create({
                email: data.email,
                password: hashPasswordFromBcrypt,
                firstName: data.firstName,
                lastName: data.lastName,
                address: data.address,
                phoneNumber: data.phoneNumber,
                gender: data.gender === '1' ? true : false,
                roleId: data.roleId,
            })
            resolve("Create a new user success!!")
        }catch(e){
            reject(e);
        }
    })
}
let hashUserPassword = (password) =>{
    //resolve: mọi việc xảy ra trơn tru, ta sẽ giải quyết được vấn đề
    //reject: từ chối việc sửdụng promise, đảm bảo luôn trả ra kết quả,tránh việc xử lí bdb của js
    return new Promise(async (resolve, reject) =>{
        try{
            var hashPassword = await bcrypt.hashSync(password, salt);
            resolve(hashPassword);
        }catch(e) {
        reject(e);
        }
    })
}

let getAllUser = () => {
    return new Promise((resolve, reject) => {
        try{
            let users = db.User.findAll({
                raw: true,
            });
            resolve(users)
        }catch(e){
            reject(e);
        }
    })
}
let getUserInfoById = (userId) => {
    return new Promise(async(resolve, reject) => {
        try{
            let user = await db.User.findOne({
                where: {id : userId},
                raw: true,
            })
            if(user) {
            resolve(user)
             }else{
            resolve([])
        }
        }catch(e){
            reject(e);
        }
    })
}

let updateUserData = (data) => {
   return new Promise (async(resolve, reject) => {
    try{
        let user = await db.User.findOne({
            where: {id: data.id}
        })
        if(user){
            user.firstName = data.firstName;
            user.lastName = data.lastName;
            user.address = data.address;
            user.phoneNumber = data.phoneNumber;

            await user.save();
            let allUsers = await db.User.findAll();
            resolve(allUsers);
        }else{
            resolve();
        }

    }catch(e){
        console.log(e);
    }
   })
}
let deleteUserById = (userId)=> {
    return new Promise(async(resolve, reject) => {
        try {
            let user = await db.User.findOne({
                where: {id: userId}
            })
            if(user) {
                await user.destroy();
            }
            resolve();
        } catch (e) {
            reject(e);
            
        }
    })
}
module.exports = {
    createNewUser: createNewUser,
    getAllUser: getAllUser,
    getUserInfoById: getUserInfoById,
    updateUserData: updateUserData,
    deleteUserById: deleteUserById,
}
